import React from 'react';

import Tabs from "../../TabNav/tabsNav.js";
import TabItem from '../../TabNav/tab.js'
import FlightsTabs from './flightTabsJson.js'

import TabNavContent from '../../TabNav/tabsContent.js'
import TabItemContent from '../../TabNav/tabcontent.js'
import FlightsTabsCon from './flightTabsConJson.js'


class Flight extends React.Component{
  render() {
    const flightabs = FlightsTabs.map(item =>
        <TabItem
          className = {item.className}
          aClassName = {item.a.className}
          datatoggle = {item.a.datatoggle}
          href = {item.a.href}
          icon = {item.a.icon}
          title = {item.a.title}
          />
        )

    return (
      <div className="flight shadow mx-5 mt-5 p-2">
        <Tabs id="flight-tabs" className="nav nav-tabs mt-5" maintabs={flightabs}  />
      </div>
    )
  }
}
export default Flight
